import React from 'react'
import logo from './assets/cohete.svg'
import './App.css'

function App() {
  return (
    <div className="App">
      <main className="App-header">
        <img src={logo} className="App-logo" alt="logo" width="150" />
      </main>
    </div>
  )
}

export default App
